import React, {useState, useEffect} from 'react'
import axios from 'axios'
import "./Enquiry.css"

const Enquiry = () => {
  const[contact, setContact]=useState([])
  useEffect(() => {
    axios.get(
        "http://localhost:5000/contact"
    )
    .then(res => {
        setContact(res.data)
    })
    .catch(err => {
        console.log(err)
    })
}, [])

  return (
    <div className='enquiry_base'>
      <h1>Enquiry</h1>

    </div>
  )
}

export default Enquiry
